import { Component } from '@angular/core';
import { BestWinLoss } from '../types';

@Component({
  selector: 'app-q7',
  templateUrl: './q7.component.html',
  styleUrls: ['./q7.component.css']
})
export class Q7Component {
  TopPlayerByGames: BestWinLoss[] = [];

  constructor(
    private leaderboardService: LeaderboardService,
  ) { }

  ngOnInit(): void {
    this.leaderboardService.getTopPlayer()
      .subscribe(TopPlayerByGames => this.TopPlayerByGames = TopPlayerByGames);
  }
}
